import time

def maxUnimodal(A):
    #Idea: create list that should have one element if unimodal and at least two if not. Since there is the possibility of having more than one peak, it will not be identified by a recursive algorithm
    B = []
    l = len(A)
    for i in range(l-2): # Testing for (the final value of) peaks in the centre of the list. If an element fits the criteria, then add its index to B
        if A[i] <= A[i+1] and A[i+1] > A[i+2]:
            B.append(i+1)
    if A[0] > A[1]: # The next two 'if' statements deal with cases where peaks are at the first or last value
        B.append(0)
    if A[l-1] >= A[l -2]:
        B.append(l-1)
    if len(B) >= 2: # If this only has one value, the list is unimodal 
        return None
    return B[0] # If B made it through the last check, A is unimodal. B's only value  is its peak's index, so it is returned.

"""A = [1,2,3,5,2]
print(A)
iA = maxUnimodal(A)
if iA == None:
    print("is not unimodal.")
else:
    print("is unimodal. Maximum is at index", iA)

B = [0,2,5,8,8]
print(B, maxUnimodal(B))

C = [9,4,2,1]
print(C, maxUnimodal(C))

Z = [4,5,2,3]
print(Z, maxUnimodal(Z))
"""
